import React, { Component } from "react";
import { TextField, Container, Button, IconButton } from "@material-ui/core";
import "./LoginOrRegister.css";
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import { faEyeSlash, faEye } from "@fortawesome/free-solid-svg-icons";

class Register extends Component {
  state = {
    isShowPassword: false,
    isShowConfirmPassword: false,
    email: "",
    password: "",
    confirmPassword: ""
  };

  render() {
    return (
      <div className="container" style={{ height: "100%" }}>
        <h3>REGISTER</h3>
        <Container>
          <TextField
            className="textFieldStyle"
            label="Email"
            margin="dense"
            variant="filled"
            value={this.state.email}
            onChange={event => this.setState({ email: event.target.value })}
          />
          <br />
          <TextField
            className="textFieldStyle"
            label="Passworld"
            margin="dense"
            variant="filled"
            type={this.state.isShowPassword ? "email" : "password"}
            color="white"
            value={this.state.password}
            onChange={event => this.setState({ password: event.target.value })}
            InputProps={{
              endAdornment: (
                <IconButton
                  onClick={() => {
                    this.setState({
                      isShowPassword: !this.state.isShowPassword
                    });
                  }}
                >
                  <FontAwesomeIcon
                    icon={this.state.isShowPassword ? faEye : faEyeSlash}
                  />
                </IconButton>
              )
            }}
          />
          <br />
          <TextField
            className="textFieldStyle"
            label="Confirm Passworld"
            margin="dense"
            variant="filled"
            type={this.state.isShowConfirmPassword ? "email" : "password"}
            color="white"
            value={this.state.confirmPassword}
            onChange={event =>
              this.setState({ confirmPassword: event.target.value })
            }
            InputProps={{
              endAdornment: (
                <IconButton
                  onClick={() => {
                    this.setState({
                      isShowConfirmPassword: !this.state.isShowConfirmPassword
                    });
                  }}
                >
                  <FontAwesomeIcon
                    icon={this.state.isShowConfirmPassword ? faEye : faEyeSlash}
                  />
                </IconButton>
              )
            }}
          />
          <br />
          <Button
            className="buttonStyle"
            onClick={this.handleRegister.bind(this)}
            style={{
              width: 500,
              marginTop: 50,
              background: "green",
              color: "white"
            }}
          >
            REGISTER
          </Button>
        </Container>
      </div>
    );
  }
  handleRegister() {}
}

export default Register;
